Powerful and versatile GPS application for any recreational or professional use. Record tracks, capture points, create and follow routes, navigate with online, cached, or custom imported maps, share location with others. The Express Edition is a fully customizable navigation and mapping solution with support for customized PathAway maps. Use the PathAway tools to create and calibrate your own layered maps. Any digitized map can be turned into a moving map navigational chart. PathAway maps can also be created or acquired from third-party sources. Visit http://pathAway.com for links to PathAway map sources.

