PathAway's powerful feature-set makes it useful for any off-road GPS activity such as aviation, boating, off-road driving, hiking, cycling, touring, Geocaching, rally racing, motorcycle touring, running and athletic training, ballooning, fishing, hunting, paragliding, mountain climbing, ultra-light flying, canoeing, snowmobiling, scuba diving, outdoor education, mapping/GIS, mining, military training, surveying, site inspection, telematics, field data collection, search and rescue, or any application where location is important. 

Features: 
- Tried and tested software base developed with user feedback over the last 10 years;

Maps: 
- Use online maps from OpenStreetMap, OpenCycleMap, USGS Topos; 
- Maps are downloaded on-the-fly as you travel; 
- Maps can be cached for off-line use when connectivity is not available; 
- Import and use customized PathAway maps created using PathAway or 3rd party Tools;

Tracking: 
- perform extensive GPS track logging limited only by system memory; 
- Pause and continue track timer for precision timing; 
- One touch "BackTrack" feature to find your way home after recording your way out; 
- Manage and Edit Track logs and track points; 
- Share location with others, monitor their location on the map.

Points: 
- Capture points, describe by name, icon, description, photo; 
- Over 100 icons to choose from; 
- Manage and Edit Points; 
- Organize your points by creating multiple Points Databases; 

Navigation: 
- Navigate using point-to-point or multi-point routes; 
- Create navigational routes simply be tapping on the map to add or insert route points; 
- Proximity to point and off-track Alarms; 
- Auto Rotate maps to direction of travel
- Uses build-in magnetic compass for slow speed directional location. Great for Geocaching when you’re trying to pin-point a cache.. 
- View navigational information on a customizable dashboard; 
- Map View or Compass and Info Views; 
- Multiple coordinate grid and datum display including lat/long, UTM, OSGB, MGRS, MGA, GGRS87, Warschauer, Localized Grids for Austria, Germany, Quebec, Sweden, Switzerland, Israel. 

- Import/Export GPX, KML, KMZ, and PathAway delimited files. 

- For advanced features and location sharing, see PathAway PRO is available as stand-alone or in-app upgrades.

NOTE: Continued use of GPS running in the background can decrease battery life. Background processing can be configured in the Settings dialog.
